import React from "react";
import { Model } from "survey-core";
import { Survey } from "survey-react-ui";
import "survey-core/defaultV2.min.css";
import { json } from "./json";
import { useSelector, useDispatch } from "react-redux";
import { useEffect, useState } from "react";
import axios from "axios";

function SurveyComponent() {
    const survey = new Model(json);

    useEffect(() => {survey.onComplete.add((sender, options) => {
        const user = useSelector((state) => state.auth.user)

        const answers = sender.data;
        const answerOne = (answers.question1[0])
        const answerTwo = (answers.question2)

        axios.get('http://localhost:8080/questionnaire', {params: {user, answerOne, answerTwo}})
        .then(res => {
            console.log("submitted")
        }).catch(err => setError("couldnt fetch"))
        }
    )

    return (<Survey model={survey} />);
}, [user])}

export default SurveyComponent;
